import React from 'react';
import logo from './logo.svg';
import './Nav.css';

function LeftNav() {
  return (
    <div className="LeftNav">
    </div>
  );
}

function RightNav() {
  return (
    <div className="RightNav">
    </div>
  );
}

function Nav() {
  return (
    <nav className="App-header">
      <LeftNav />
      <RightNav />
    </nav>
  );
}

export default Nav;
